<!-- BASEMAP COLOURING -->		

			function getBasemap(evt){
				var col = [];
				
				for (var i = 0; i < districts.length; i++){		// Loop over all districts
					var Wohnungen = districts[i][1];					// to get first index in the array
					if(!isNaN(Wohnungen)){							// If array contains classification number ...
					 		 if (Wohnungen < 40 && Wohnungen > 20){
								col = '#FF6600';
							} 
							 else if (Wohnungen > 40){
								col = '#FF3300';
							} 
							else {
								col = '#FF9900';
							}
											
							var SVGid = 'stateId' + (i);			// re-assigning index to state that should be coloured
								if(document.getElementById(SVGid)){
								document.getElementById(SVGid).setAttributeNS(null,'fill',col);		// Change fill acording to array state if
							}
						}
					}
				}	
				

<!--*********************************************************************** -->
<!-- Area COLOURS -->		
 
 			function getArea(evt){
				var Mcol = [];
				for (var i = 0; i < districts.length; i++){
					var Mrank = districts[i][2];
					if(!isNaN(Mrank)){
						if (Mrank < 30.00){
								Mcol = '#33FF99';
							} else if (Mrank > 120.00){
								Mcol = '#333399';
							} else if (Mrank > 60.00 && Mrank < 90.00){
								Mcol = '#339999';
							} else if ( Mrank > 90.00 && Mrank < 120.00){
								Mcol = '#336699';	
							} else if (Mrank > 30.00 && Mrank < 60.00){
								Mcol = '#33CC99';		
							}  else {
								Mcol = '#33FF99';
							}											
							var SVGid = 'stateId' + (i);
								if(document.getElementById(SVGid)){
								document.getElementById(SVGid).setAttributeNS(null,'fill',Mcol);
							}
						}
					}
				}	
				
				

<!--*********************************************************************** -->
<!-- unemp RATING COLOURS -->		

			function SPColoring(evt){
				var SPcol = [];
				for (var i = 0; i < districts.length; i++){
					var Srank = districts[i][5];
					if(!isNaN(Srank)){
						if (Srank > 16){
								SPcol = '#CC3300';
							} else if (Srank > 14 && Srank < 16 ){
								SPcol = '#CC6600';
							} else if (Srank > 12 && Srank < 14){
								SPcol = '#CC9900';
							} else if (Srank > 10 && Srank < 12){
								SPcol = '#CCCC00';	
							} else {
								SPcol = '#CCCC00';
							}											
							var SVGid = 'stateId' + (i);
								if(document.getElementById(SVGid)){
								document.getElementById(SVGid).setAttributeNS(null,'fill',SPcol);
							}
						}
					}
				}	
					


<!--*********************************************************************** -->
<!-- Companies COLOURS -->		
			function FColoring(evt){
				var Fcol2 = [];
				<!-- Looping districts -->
				for (var i = 0; i < districts.length; i++){
				<!-- Classification according to EU-Member status -->
					var comp = districts[i][6];
							
	                   if(!isNaN(comp)){
						if (comp > 20){
								Fcol2 = '#CC9933';
							} else if (comp > 15 && comp < 20){
								Fcol2 = '#CC9966';
							} else if (comp > 10 && comp < 15){
								Fcol2 = '#CC9999';
							} else if (comp > 5&& comp < 10){
								Fcol2 = '#CC99CC';	
							}  else {
								Fcol2 = '#CCCCFF';
							}											
							var SVGid = 'stateId' + (i);
								if(document.getElementById(SVGid)){
								document.getElementById(SVGid).setAttributeNS(null,'fill',Fcol2);
							}
						}
					}
				}		
				
				
<!--*********************************************************************** -->
<!-- population COLOURS -->		
			function popColoring(evt){
				var Fcol = [];
				<!-- Looping districts -->
				for (var i = 0; i < districts.length; i++){
				<!-- Classification according to EU-Member status -->
					var Frank = districts[i][3];
	
	
	              if(!isNaN(Frank)){
						if (Frank > 350000){
								Fcol = '#660066';
							} else if (Frank > 300000 && Frank < 350000){
								Fcol = '#CC33FF';
							} else if (Frank > 250000 && Frank < 300000){
								Fcol = '#CC66FF';
							} else if (Frank > 200000&& Frank < 250000){
								Fcol = '#CC99FF';	
							}  else {
								Fcol = '#CCCCFF';
							}										
							var SVGid = 'stateId' + (i);
								if(document.getElementById(SVGid)){
								document.getElementById(SVGid).setAttributeNS(null,'fill',Fcol);
							}
						}
					}
				}		

