<!-- PUBLIC DEBT LAYER on/off -->
  
function debtLayerControl(evt,barValue,chartElems){
				var buttonId = evt.target;
				var buttonIdFill = buttonId.getAttribute("fill");		// get fill of buttonId	
				var ChartLayer = document.getElementById(""+barValue);	// get chartvalues
				var axisElem = document.getElementById(""+chartElems);	// get associated chart elements
				
				//  If button was turned on on-click...
				if (buttonIdFill == "url(#buttonOn)"){
					buttonId.setAttribute("fill","black");				// turn buttonId off by setting attribute fill to black
					ChartLayer.setAttribute("display","none");			// Turn layer & legend off
					axisElem.setAttribute("display","none");
					
					document.getElementById('button8').setAttribute("fill","black");
					document.getElementById('button9').setAttribute("fill","black");
					getPubDept(evt);
				}
				
	
				//  If button was turned off ...
				else {
					buttonId.setAttribute("fill","url(#buttonOn)");					// higlight buttton by referencing to pattern
					ChartLayer.setAttribute("display","initial");					// display chartvalues
					axisElem.setAttribute("display","inline");						// display chart elements 
				
					document.getElementById('button8').setAttribute("fill","black");	// Mute other buttons
					document.getElementById('button9').setAttribute("fill","black");
					document.getElementById('GDPchart').setAttribute("display","none");	// Hide other charts
					document.getElementById('unempChart').setAttribute("display","none");
					getPubDebt(evt);
				}
			}	



