	Map description and comments
	
	
	
	
	
		
	This thematic map is a depiction of Berlin Districts for showing the Quality of life in order to choose the best district 
    to help in decision-making process for the International Company to choose their location. 
	
	
   Functions : 	
	Many types of interactivite functions have been implemented in order to visualize information.
	
	Mouse hover on a district: Displays the district name in a small yellow box, and for each district within the map
	   at the left box for Information box showing data as : Districts name , Area , population , 
	    population density , ratio of 3 apartments  in one building  and finally the ratio of un employment . 
	
	
	Clicking:  Clickable elements are all map elements and many text elements that appear underlined and in blue on hover.
	Clicking on them will open information from external sources in a new tab .
	
	Buttons: The field "Layer control " at the top right box contains clickable buttons that when clicking on it show different maps and boxes . 
	On Clicking on the Red button "Base map " will show the basemap for berlin districts with different layer for showing 
	 the ratio of 3 apartments  in one building ding , The other 4 yellow buttons for 4 different groups(categories) . 
      On Clicking on the Green button "bar chart " will show a bar chart for berlin districts ratio of 3 apartments  in one building .  
        On Clicking on the blue button "Map description " will show the current box .  

         Map Legend :  at the left box will be updated for each map layer .
	   
	   
	      Decision Making Process : 
         The district "Mitte" is the best option to put the international company based on the life quality and for many reasons : 
          1- At the first criteria on the base map Mitte considered as the highest value  for the opportunity to have 3 or more apartments in one 
		                       building as 100 % ,so that means more chances to have offices in any building in Mitte .  
                    2- The position of Mitte in the middle of berlin so it is not far away from any other district and it is more easy and faster to reach it .   
                 3- According to the number of  Companies with social insurance contributions and / or controllable revenues from goods and services  
			   in Berlin , Mitte consider from the highest districts that has number of companies as : 20 000 companies .
             4-According to the number of inhabits Mitte also considered as from the highest value for populations as : 356506  inhabits , 
		  	that as its special position and the more opportunity to find job , So it will be good for any company wants to choose location   
		     that contains more customers and more people . 

	

	
	
			
